import React from 'react';

const Footer = () => {

  return (
    <footer>
      <div className="container">
        <h4>TechWorld</h4>
        <ul>
          <li><a href="#!"><i className="fab fa-twitter-square"></i></a></li>
          <li><a href="#!"><i className="fab fa-facebook-square"></i></a></li>
        </ul>
      </div>
    </footer>
  )
}

export default Footer;
